import React, { Component } from 'react'

import 'bootstrap/dist/css/bootstrap.min.css'

export default class CardScore extends Component {
   render() {

      const { headerText, bodyText, cardText } = this.props;

      return (
         <div class="card bg-dark text-white m-2">
            <div class="card-body">
               <div class="card-header">
               <i class="fas fa-sync-alt pull-right"></i>
               </div>
               <h5 class="card-title">{this.props.title}</h5>

               <p class="card-text">{this.props.body}</p>
            </div>
         </div>
      )
   }
}
